import React, {useEffect, useState} from "react";
import axios from "axios";

const RaceDetail = (props) => {

  const [race, setRace] = useState({});

  useEffect(() => {
    axios.get("https://api.thecatapi.com/v1/images/search?breed_ids=beng", {'headers': {'x-api-key': '80ad793a-81c0-4987-a01a-cdf448c1b68d'}}).then(response => {
      setRace(response.data);
      console.log(race);
    });
  }, []);

  return (
    <div>
      <p>bonsoir</p>
      <h1>{race.name}</h1>
    </div>
  );
}

export default RaceDetail;
